import './NavigationBar.css'; // Importa el archivo de estilos CSS

function NavigationBar() {
  return (
    <nav className="navigation-bar">
      <ul className="navigation-list">
        <li className="navigation-item"><a href="/">Inicio</a></li>
        <li className="navigation-item"><a href="/tienda">Tienda</a></li>
        <li className="navigation-item"><a href="/vendedores">Vendedores</a></li>
        <li className="navigation-item"><a href="/mi-cuenta">Mi Cuenta</a></li>
        <li className="navigation-item"><a href="/carrito">Carrito</a></li>
      </ul>
    </nav>
  );
}

export default NavigationBar;
